import React from 'react';
import '../styles/nav.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faInfoCircle, faTags, faEnvelope, faSun, faLightbulb } from '@fortawesome/free-solid-svg-icons';

function NavBar() {
  return (
    <div className="navbar">
      <div className="menu">
        <div><a href="/mainPage"><FontAwesomeIcon icon={faHome} /></a></div>
        <div><a href="/Category"><FontAwesomeIcon icon={faTags} /></a></div>
        <div><a href="/About"><FontAwesomeIcon icon={faInfoCircle} /></a></div>
        <div><a href="/Contact"><FontAwesomeIcon icon={faEnvelope} /></a></div>
      </div>
      <div className='nav-light'><a href="/LightMode"><FontAwesomeIcon icon={faLightbulb} /></a></div>
    </div>
  );
}

export default NavBar;
